<!-- Automatic redirect on button or auto click on claim button-->

  <style>
    #overlay {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color: white;
      z-index: 999;
      display: none;
    }
  </style>


<div id="overlay"></div>
<button id="startButton">Start</button>

<script>
document.getElementById("startButton").addEventListener("click", function() {
  var urls = ["https://example.com/page1", "https://example.com/page2", "https://example.com/page3"];
  var randomUrl = urls[Math.floor(Math.random() * urls.length)];

  localStorage.setItem("randomRedirect", randomUrl);

  // Show the overlay before redirection
  document.getElementById("overlay").style.display = "block";

  // Redirect immediately
  window.location.replace(randomUrl);
});

var savedRedirect = localStorage.getItem("randomRedirect");
if (savedRedirect) {
  // Show the overlay before automatic redirection
  document.getElementById("overlay").style.display = "block";

  // Redirect immediately
  window.location.replace(savedRedirect);
}

// hide start button Place this script after the button element in your HTML

document.getElementById("startButton").style.display = "none";

</script>
<script>
  
    
    //date showing js code script 
    document.addEventListener("DOMContentLoaded", function() {
            var today = new Date();
            var dd = String(today.getDate()).padStart(2, '0');
            var mm = String(today.getMonth() + 1).padStart(2, '0'); // January is 0!
            var yyyy = today.getFullYear();
            var formattedDate = dd + '/' + mm + '/' + yyyy;

            document.getElementById("dateContainer").innerText = formattedDate;
        });
</script>
